import React, {useState} from "react";

const SponsorPage = () => {
    const [display, setDisplay] = useState("Senior");

  return (
    <>
        <div className="py-10">
            <div className='text-gray-500 py-5 mx-auto text-center'>
                <div className=" text-5xl font-bold text-gray-500 underline decoration-green-500 ">Sponsors</div>
            </div>

            <div className="my-5 flex  items-center text-gray-500 py-10">

                <button
                className={`button text-2xl px-4 font-bold border-b-4 ${
                    display === "Senior" ? "border-green-500" : ""
                } transition duration-300`}
                onClick={() => setDisplay("Senior")}
                >
                Senior
                </button>
                <button
                className={`button text-2xl px-4 font-bold border-b-4 ${
                    display === "U19" ? "border-green-500" : ""
                } transition duration-300`}
                onClick={() => setDisplay("U19")}
                >
                U19
                </button>
             </div>
        </div>
    </>
  );
};

export default SponsorPage;
